// adheres to bottom of screen/app
// 3 buttons, profile, search, and logout
// grid layout in css file, 3 columns
import { useContext } from 'react';
import { Link } from 'react-router-dom';
import { UserContext } from './context/userProvider';

export default function NavBar(props){
    const {
        logout
    } = useContext(UserContext)

    return(
        <div className='flex flex-row fixed bottom-0 w-screen bg-cyan-700'>
            <Link to='/recent_mood_artists'> <button className='w-full '> profile </button> </Link>
            <Link to='/search'> <button className='w-full p-2'> search </button> </Link>
            <Link to='/lists'> <button className='w-full p-2'> friends </button> </Link>
            <button className='bg-cerise-700 w-full' onClick={logout}> logout </button>
        </div>
    )
}
